import {Injectable} from "@angular/core";

@Injectable()
export class PictureService {

  getPictures(): string[]  {
    let result = [];

    result[0] = this.addLoki();
    result[1] = this.addJoker();
    result[2] = this.addJessica();
    result[3] = this.addKingpin();
    result[4] = this.addMelissandra();

    return result;
  }

  addLoki(): string {
    return 'data:image/jpeg;base64,';
  }

  addJoker(): string {
    return 'data:image/jpeg;base64,';
  }

  addJessica(): string {
    return 'data:image/jpeg;base64,';
  }

  addKingpin(): string {
    return 'data:image/jpeg;base64,';
  }

  addMelissandra(): string {
    return 'data:image/jpeg;base64,';
  }
}
